INSERT INTO `peliculas` VALUES (1,'Spider-Man: No Way Home','2h 28m','Tras descubrirse la identidad secreta de Peter Parker como Spider-Man, la vida del joven se vuelve una locura. Peter decide pedirle ayuda al Doctor Extraño para recuperar su vida. Pero algo sale mal y provoca una fractura en el multiverso.','https://bolivarense.com/wp-content/uploads/2021/12/KEY_ART_1400x2100-2.jpg'),(2,'Morbius','1h 44m','Uno de los personajes más convincentes y conflictivos de Sony Pictures Universe of Marvel Characters llega a la gran pantalla cuando el ganador del Oscar® Jared Leto se transforma en el enigmático antihéroe Michael Morbius. Peligrosamente enfermo con un trastorno sanguíneo poco común y decidido a salvar a otros que sufren su mismo destino, el Dr. Morbius intenta una apuesta desesperada. Si bien al principio parece ser un éxito radical, se desata una oscuridad en su interior. ¿El bien prevalecerá sobre el mal, o Morbius sucumbirá a sus misteriosos nuevos impulsos?','https://www.ecartelera.com/carteles/14400/14458/001_m.jpg'),(3,'The Batman','2h 56m','En su segundo año luchando contra el crimen, Batman explora la corrupción existente en la ciudad de Gotham y el vínculo de esta con su propia familia. Además, entrará en conflicto con un asesino en serie conocido como \"el Acertijo\".','https://cinelandia.com.co/archivos/proximo/Afiche_Nuevos_b.jpg'),(4,'Sonic 2','2h 2m','Después de establecerse en Green Hills, Sonic quiere demostrar que tiene madera de héroe. La prueba de fuego llega con el retorno del malvado Robotnik, y su nuevo compinche, Knuckles, en busca de una esmeralda que destruye civilizaciones.','https://www.ecartelera.com/carteles/16600/16674/001_m.jpg'),(5,'Jujutsu Kaisen 0','1h 45m','Yuta Okkotsu es un chico de instituto bastante nervioso con un grave problema: Su amigo Rika se ha convertido en un \"Curse\" y no le deja a solas. Ya que Rika no es un Curse ordinario, capta la atención de Satoru Gojo, un profesor del Instituto \"Jujutsu\", donde los exorcistas aprenden a combatir a los Curse. Gojo convence a Yuta para enrolarse en al academia... ¿Podrá aprender Yuta a controlar al Curse que le atormenta?. Precuela de la serie anime \"Jujutsu Kaisen\".','https://image.tmdb.org/t/p/original/eiSlgyx7G61Ey69K9MmCw9OaHMA.jpg'),(6,'Los tipos malos','1h 40m','Un autobús de transporte de prisioneros vuelca en un accidente, permitiendo que los peligrosos reclusos escapen y se den a la fuga. La policía, desesperada y a contrarreloj, decide agrupar un equipo especial de investigación de delito.','https://cartelera.elpais.com/assets/uploads/2022/03/18030135/C_24313.jpg'),(7,'SAO: Progressive Movie','1h 37m','Un mes después de que el juego mortal de Kayaba Akihiko empezara, el número de muertes sigue subiendo, 2.000 jugadores ya han perdido la vida en el difícil mundo VRMMO de Sword Art Online. El día en el que se plantea la estrategia para luchar contra el jefe final de la primera planta, Kirito, un jugador solitario que asegura que juega solo para hacerse más fuerte, conoce a una jugadora, Asuna Yuuki, que es muy poderosa.','https://i0.wp.com/www.gamerfocus.co/wp-content/uploads/2021/09/SAO-Progressive.jpg?resize=725%2C1024&ssl=1'),(8,'Encanto Sing-Along','1h 39m','Una joven colombiana puede ser la última esperanza para su familia, cuando descubre que la magia que rodea a Encanto, un lugar encantado que bendice a los niños con dones únicos, se encuentra en serio peligro.','https://www.paginacentral.com.ar/wp-content/uploads/2021/11/Encanto.jpg'),(9,'Doctor Strange en el Multiverso de la Locura','2h 6m','El Dr. Stephen Strange abre un portal al multiverso al utilizar un hechizo prohibido. Ahora su equipo debe enfrentarse a una amenaza enorme.','https://es.web.img3.acsta.net/pictures/22/02/14/11/28/0714462.jpg');
/*!40000 ALTER TABLE `peliculas` ENABLE KEYS */;
